import React, { Component,Fragment } from 'react'
import styled from 'styled-components'
import Kkwe from '../images/Kkwe.png'
import 'react-alice-carousel/lib/alice-carousel.css'
import AOS from 'aos';
import 'aos/dist/aos.css';

const Container = styled.div`
justify-content:center;
align-items:center;
margin:0 auto;
height:100%;
`
const  Holder = styled.div`
border-bottom:2px solid white;
display:flex;
margin: 0px auto;
padding-bottom: 0px;
flex-direction:row;
width:80vw;
@media (min-width: 1px) and (max-width: 426px) {
 width:100%;
 }
`

const  HolderInner = styled.div`
display:flex;
margin: 10vw 0vw 5vw 0vw;
padding-bottom: 0px;
flex-direction:column;
width:100%;
@media (min-width: 1px) and (max-width: 426px) {
 width:100%;
 }
`

const ProjectImg =styled.img`
width:100%;
height:100%;
`
const ProjectImgHolder =styled.div`
width:35vw;
height:15vw;
margin: 5vw 0vw 5vw 0vw;
`
const ProjectHeading =styled.h1`
font-size:6vw;
color:white;
font-family:arial;
font-weight:bolder;
`

const Heading =styled.h1`
font-size:1vw;
color:white;
font-family:arial;
margin: 0.5vw 0vw 0.5vw 0.5vw;
font-weight:bolder;
`

class Gallery1 extends Component {
 componentDidMount(){
    AOS.init({
      duration : 1000
    })
  }
  render() {



    return (

      <Container>

  <Holder data-aos='slide-up' data-aos-duration="1200"> 
      <HolderInner>
      <ProjectHeading  >Kkwe</ProjectHeading>
